import React from 'react';
import './App.css';
import Header from './components/Header'
import Contents from './components/Contents'

class App extends React.Component {
  render()
  {
    return (
    <div className="App">
      <Header/>
      <Contents/>
    </div>
  );
  }
}

export default App;
